def color_dodge_8(base: List[List[int]], active: List[List[int]]) -> List[List[int]]:
    def pixel_operation(b: int, a: int) -> int:
        if a == 32:
            return 32
        elif a == 31:
            return b
        else:
            return min(32, b * 32 // (32 - a))

    return matrix_where(
        matrix_where(
            base,
            active,
            pixel_operation
        ),
        active,
        lambda x, y: x
    )

